const test=require("tap").test,zlibA=require("zlib"),zlibB=require(".."),crypto=require("crypto");test("zlibA.deflate -> zlibB.inflate",function(e){const n=crypto.randomBytes(1024);zlibA.deflate(n,function(t,r){zlibB.inflate(r,function(t,r){e.same(r,n,"should match"),e.end()})})}),test("zlibB.deflate -> zlibA.inflate",function(e){const n=crypto.randomBytes(1024);zlibB.deflate(n,function(t,r){zlibA.inflate(r,function(t,r){e.same(r,n,"should match"),e.end()})})}),test("zlibB.deflate -> zlibA.inflate (string)",function(e){const n="ohaihihihihihihihihihihihihihihihi";zlibB.deflate(n,function(t,r){zlibA.inflate(r,function(t,r){e.same(r.toString(),n,"should match"),e.end()})})}),test("zlibA.gzip -> zlibB.gunzip",function(e){const n=crypto.randomBytes(1024);zlibA.gzip(n,function(t,r){zlibB.gunzip(r,function(t,r){e.same(r,n,"should match"),e.end()})})}),test("zlibB.gzip -> zlibA.gunzip",function(e){const n=crypto.randomBytes(1024);zlibB.gzip(n,function(t,r){zlibA.gunzip(r,function(t,r){e.same(r,n,"should match"),e.end()})})}),test("zlibB.gzip -> zlibA.gunzip",function(e){const n="lololololoollolololoololololololololololololololololololololol";zlibB.gzip(n,function(t,r){zlibA.gunzip(r,function(t,r){e.same(r.toString(),n,"should match"),e.end()})})});